import BarButton from "../Shared/BarButton";
const FriendBar = (props) => {
    return (
        <div id = "FriendBar">
            <BarButton func = {props.children.getFriends} name = "All"></BarButton>
            <BarButton func = {props.children.getFriends} name = "Sent"></BarButton>
            <BarButton func = {props.children.getFriends} name = "Received"></BarButton>
            <BarButton func = {props.children.getFriends} name = "Blocked"></BarButton>
            <BarButton func = {props.children.getFriends} name = "Add Friend"></BarButton>
        </div>
    )

}

export default FriendBar;
